'use strict';

var _modules = require('ui/modules');

var _monitoring_service = require('./monitoring_service');

require('../cluster');

_modules.uiModules.get('xpack/logstash').factory('xpackLogstashMonitoringService', function ($injector) {
  var $http = $injector.get('$http');
  var Promise = $injector.get('Promise');
  var monitoringUiEnabled = $injector.has('monitoringUiEnabled') && $injector.get('monitoringUiEnabled');
  var clusterService = $injector.get('xpackLogstashClusterService');
  return new _monitoring_service.MonitoringService($http, Promise, monitoringUiEnabled, clusterService);
